import Mock from 'mockjs'
import room from './room'
Mock.mock('/room/user',room.user);
Mock.mock('/room/admin/',room.admin);
Mock.mock('/reservation/user',{
    id: 1,
    roomId: 1,
    start: '1-1-2000',
    end: '1-1-2000'
});
Mock.mock('/reservation/admin',{
    id:1,
    roomId:1,
    userId:1,
    start:'1-1-2000',
    end:'1-1-2000'
});
